import './Home.css'
import Navbar from '../components/Navbar';
import ProfileCard from '../components/ProfileCard';
const Home = () => {
    return(
        <div>
            <div>
                <Navbar/>
            </div>
            <div className='content'>
                <div className='profile-card'>
                    <ProfileCard/>
                </div>
            </div>
        </div>
    );
}

export default Home;
